Data binding requires the binder feature, which will also trigger activation of the optional serde dependency and is required for deserialization. Data binding leverages the serde crate to enable deserializing configurations in part, or in whole, into strongly-typed structures. It is also possible to retrieve strongly-typed scalar values. A Configuration is deserialized through the ConfigurationBinder trait: pub trait ConfigurationBinder { fn reify<T: DeserializeOwned>(&self) -> T; fn bind<T: DeserializeOwned>(&self, instance: &mut T); fn bind_at<T: DeserializeOwned>(&self, key: impl AsRef<str>, instance: &mut T); fn get_value<T: FromStr>(&self, key: impl AsRef<str>) -> Result<Option<T>, T::Err>; fn get_value_or_default<T>(&self, key: impl AsRef<str>) -> Result<T, T::Err> where T: FromStr + Default;
} Consider the following struct: use serde::Deserialize; #[derive(Default, Deserialize)]
#[serde(rename_all(deserialize = "PascalCase"))]
struct ContactOptions { name: String, primary: bool, phones: Vec<String>,
} Configuration keys are normalized or expected to otherwise be Pascal Case for consistency. The following demonstrates how to load a configuration and then reify the configuration into the struct that was defined above. This example used the in-memory configuration provider , but any configuration provider or multiple configuration providers can be used. use config::{*, ext::*}; fn main() { let config = DefaultConfigurationBuilder::new() .add_in_memory(&[ ("name", "John Doe"), ("primary", "true"), ("phones:0", "+44 1234567"), ("phones:1", "+44 2345678"), ]) .build() .unwrap(); let primary: bool = config.get_value_or_default("primary").unwrap(); let options: ContactOptions = config.reify(); println!("Is Primary: {}", primary); println!("{}", &options.name); println!("Phones:"); for phone in &contact.phones { println!("\n {}", phone); }
} It is also possible to bind an existing structure to an entire configuration or bind at a specific configuration section . use config::{*, ext::*}; fn main() { let config = DefaultConfigurationBuilder::new() .add_in_memory(&[ ("name", "John Doe"), ("primary", "true"), ("phones:0", "+44 1234567"), ("phones:1", "+44 2345678"), ]) .build() .unwrap(); let mut options = ContactOptions::default(); config.bind(&mut options); println!("{}", &options.name); println!("Phones:"); for phone in &contact.phones { println!("\n {}", phone); }
} Note : The bound struct must implement Deserialize::deserialize_in_place to perform a true, in-place update. The default implementation creates a new struct and binds to it, which is essentially the same as mutating the struct to the result of reify .

